sources.styles/blocks/page.scss:
* {
  margin: 0;
  padding: 0;
  text-decoration: none;
  list-style: none;
  box-sizing: border-box;
}

.page {
  &__body {
    font-family: 'Inter', sans-serif;
    background: #FFEEFC;
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;

    transform: translateX(-100%);
    transition: transform 0.4s;

    &:target {
      transform: translateX(0);
    }
  }
}

