sources.styles/utils/_mixins.scss:
@mixin text($f-z, $let-sp, $f-w) {
  font-size: $f-z;
  letter-spacing: $let-sp;
  font-weight: $f-w;
}

@mixin flexible() {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

@mixin footer-flex {
  display: flex;
  flex-direction: column;
  row-gap: 16px;
}

@mixin mini-tablet {
  @media (min-width: 552px) {
    @content;
  }
}

@mixin tablet {
  @media (min-width: 640px) {
    @content;
  }
}

@mixin middle-tablet {
  @media (min-width: 768px) {
    @content;
  }
}

@mixin desktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin large-screen {
  @media (min-width: 1200px) {
    @content;
  }
}

sources.styles/blocks/header.scss:
.header {
  &__menu {
    display: none;

    @include middle-tablet() {
      display: block;
      @include flexible();
      gap: 67px;
    }
  }

  &__list {
    @include flexible();
    gap: 64px;
  }

  &__link {
    @include text(16px, -0.01em, 400);
    color: #1C1A26;

    &:hover {
      color: #F9512E;
    }
  }

  &__main-content {
    padding: 32px 0 80px 0;

    @include mini-tablet() {
      padding: 80px 0 80px 0;
    }

    @include desktop() {
      position: relative;
      padding: 0;
    }
  }

  &__subtitle {
    text-align: center;
    padding-bottom: 32px;
    max-width: 288px;
    margin: 0 auto;

    @include mini-tablet() {
      margin: 0;
      text-align: left;
      padding-bottom: 16px;
      width: 100%;
    }

    @include desktop() {
      position: absolute;
      top: 135px;
    }

    @include large-screen() {
      top: 144px;
    }
  }

  &__title {
    @include text(64px, -0.05em, 400);
    text-transform: uppercase;
    color: #F9512E;
    text-align: center;
    line-height: 54px;
    @include mini-tablet() {
      position: absolute;
      top: 50%;
      left:50%;
      transform: translate(-50%, -50%);
      width: 100%;
    }

    @include middle-tablet {
      font-size: 80px;
      line-height: 68px;
    }

    @include desktop() {
      font-size: 115px;
      line-height: 116px;
      width: 100%;
    }

    @include large-screen() {
      font-size: 136px;
      line-height: 122px;
    }
  }

  &__img-container {
    text-align: center;
  }

  &__img {
    width: 288px;

    @include mini-tablet() {
      width: 326px;
    }

    @include desktop() {
      width: 544px;
    }

    @include large-screen() {
      width: 584px;
    }
  }

  &__button {
    display: block;
    width: 100%;
    margin: 0 auto;
    max-width: 326px;

    @include middle-tablet() {
      margin-top: 80px;
    }

    @include mini-tablet {
      display: block;
      width: 100%;
    }

    @include desktop() {
      margin-top: 0;
      position: absolute;
      top: 395px;
    }

    @include large-screen() {
      top: 418px;
    }
  }

  &__button-text {
    display: inline-block;

    padding: 18px 0 18px 26px;
    text-align: center;
  }
}

sources.styles/blocks/button.scss:
.button {
  border: 2px solid #F9512E;
  border-radius: 32px;
  background-color: #FFEEFC;

  transition: all 8ms;

  &__text {
    font-family: 'Inter', sans-serif;
    @include text(16px, 0.02em, 500);
    text-transform: uppercase;
    line-height: 16px;
    color: #F9512E;

    background-image: url(../images/minicookie.svg);
    background-repeat: no-repeat;
    background-position: 0 50%;
  }

  &:hover {
    background-color: #F9512E;
  }

  &:hover .button__text {
    cursor: pointer;
    background-image: url(../images/white-minicookie.svg);
    color: #FFFFFF;
  }

  &:focus {
    outline: none;
    border: 2px solid #B2341A;
    background-color: #B2341A;
  }

  &:focus .button__text {
    background-image: url(../images/white-minicookie.svg);
    color: #FFFFFF;
  }

  &:disabled {
    opacity: 0.5;
  }
}

