sources.styles/blocks/grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);

  @include mini-tablet {
    grid-template-columns: repeat(8, 1fr);
    column-gap: 24px;
  }

  &--desktop {
    display: block;

    @include mini-tablet {
      display: grid;
    }
  }

  &__item {
    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }

        &--mini-tablet-#{$start}-#{$end} {
          @include mini-tablet() {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }

    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }

        &--desktop-#{$start}-#{$end} {
          @include desktop() {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }
  }
}

